INSERT INTO public.eessite VALUES (4, 'Abbassiya, T el', '0', NULL, NULL, 'SE of Tell Rak', '123 x 100 x 1.5m', 593, 'Amsterdam University survey of 1984-5: partly levelled for agriculture and settlement. Sherds noted from OK and NK. The SCA list combines this site with T. Iswid (our 594) and gives coordinates between the two mounds. Satellite imagery shows the large, flat expanse of Tell el-Iswid lying amongst the cultivated fields about 300 metres north-east of the smaller Tell el-Abbassiya, which is partly overbuilt by a cemetery. Both mounds have been substantially reduced in size. The straight edges of Tell el-Iswid, in particular, are the result of field encroachment.
INSERT INTO public.eessite VALUES (7, 'Abdu Basha', '0', NULL, NULL, '6km SE of Kafr ed Dauwar', 'overbuilt', 621, 'This is a mound overbuilt by the village of Ezbet Abdu Pasha.', 'SoE 1:100,000 (1916). SCA Beheira register no. 100147.', '31┬░4''54ÔÇ£', '30┬░9''20ÔÇ£', 31.0816666667, 30.1555555556, NULL, 'Abdu Basha', 228631.353451, 3442132.0323, '0', '01010000207C7F00002E1EDED3BAE80B410A682204EA424A41');
INSERT INTO public.eessite VALUES (122, 'Awlad Daoud, T', '0', NULL, NULL, '15km SW of Bilbeis', 'levelled', 664, 'An extensive site below the fields, but only about half a feddan is registered. The SCA excavations of Mr Moshen Helmy (1992-1997) found three settlement phases (Protodynastic to Old Kingdom), below Ptolemaic and Roman material. A pit cointained some Early Dynastic pottery models of boats, like the ivory versions from Tell Ibrahim Awad.', 'SCA Sharqiya register 13080078.', '30┬░21''47ÔÇ£', '31┬░24''14ÔÇ£', 30.3630555556, 31.4038888889, NULL, 'Awlad Daoud, T', 346612.434423, 3360096.08522, '0', '01010000207C7F00000762D9BCD12715412C7DE80AB0A24941');
