INSERT INTO public.eessite VALUES (27, 'Abu el Matamir, K', '0', NULL, NULL, 'W of Hosh Isa', 'overbuilt', 454, 'Overbuilt by the town of same name. In the north-west part of the town is a large modern cemetery on a mound.', 'SoE 1:100,000 (1916); ESA 1996 1:50,000 map NH36-I4c.', '30┬░54''50ÔÇ£', '30┬░10''10ÔÇ£', 30.9138888889, 30.1694444444, NULL, 'Abu el Matamir, K', 229483.163186, 3423493.39534, '0', '01010000207C7F00002976344E59030C4149809AB2821E4A41');
INSERT INTO public.eessite VALUES (28, 'Abu el Rus, T', '0', NULL, NULL, '7km SE of Faqus', 'destroyed', 538, 'Included in Amsterdam University survey, 1984-5. Levelled c.1970. Few human bones and limestone chips noted in fields, with Saite and possibly also some Ptolemaic sherds. Formerly covered 4 feddans, now lies on the south edge of a town.', 'SoE 1:25,000 series, 88/690; Indicated on Plan 4 in Bietak,┬áTell ed-Daba,┬áII. Brink,MDAIK┬á43 (1986), 20.┬á', '30┬░43''0ÔÇ£', '31┬░52''30ÔÇ£', 30.7166666667, 31.875, NULL, 'Abu el Rus, T', 392281.116784, 3398742.39367, '0', '01010000207C7F00009339967764F1174150C763322BEE4941');
INSERT INTO public.eessite VALUES (29, 'Abu el Sobh, T', '0', NULL, NULL, '6.5km N of Faqus', '250 x 150 x 0.6m', 532, 'Amsterdam University survey 1984-5 reported site had been levelled c. 1950 and covered by an orchard. Three limestone blocks and one of granite on the site in 1984-5 suggest some monumental building. Romano-Coptic sherds.┬á', 'SoE 1:25,000 series, 89/690; Brink,┬áMDAIK43 (1986), 7ff., 21. Formerly called Tell el-Safra.┬á', '30┬░48''30ÔÇ£', '31┬░48''55ÔÇ£', 30.8083333333, 31.8152777778, NULL, 'Abu el Sobh, T', 386669.788376, 3408960.91936, '0', '01010000207C7F0000C4094C27B7991741A796AD7520024A41');
INSERT INTO public.eessite VALUES (30, 'Abu ez-Zarazir, T', '0', NULL, NULL, 'S of Damanhur', 'overbuilt', 445, 'A mound shows on satellite images up to 2009, at the SE side of a settlement. It has subsequently been overbuilt.', 'SCA Beheira register no. 100201. SoE 1:100,000 (1916). On sketch map by Coulson, in Brink,┬áArchaeology of the Nile Delta,┬á260.', '30┬░51''23ÔÇ£', '30┬░26''38ÔÇ£', 30.8563888889, 30.4438888889, NULL, 'Abu ez-Zarazir, T', 255574.50316, 3416483.93216, '0', '01010000207C7F000005C07806B4320F41D50451F7D1104A41');
INSERT INTO public.eessite VALUES (31, 'Abu Hireiz, K', '0', NULL, NULL, 'S of Abu Hummus', 'small traces', 434, 'A remnant of a mound, cut square by advance of the fields, is visible of satellite imagery. There is another small mound at 30 55 40N 30 16 29E.', 'SCA Beheira register no. 100231. SoE 1:100,000 (1916).', '30┬░55''42ÔÇ£', '30┬░16''22ÔÇ£', 30.9283333333, 30.2727777778, NULL, 'Abu Hireiz, K', 239401.571811, 3424848.68733, '0', '01010000207C7F000044A511934C390D41F06DFA5728214A41');
INSERT INTO public.eessite VALUES (48, 'Abu Tahun, K-', '0', NULL, NULL, '8 km NE of Desuq', 'Small, 1.5m high in 1983', 252, 'A small mound below a village and cemetery. Tested by DAI 1983 and found to be no older than Ptolemaic.', 'Von der Way et al.,┬áMDAIK┬á40, 323f. Position, see ESA 1996 1:50,000 map NH36-M2a. P Ballet and T von der Way, in┬áMDAIK┬á49 (1993), 12, 14-15 and Fig.7, nos. 39-43.', '31┬░12''2ÔÇ£', '30┬░42''22ÔÇ£', 31.2005555556, 30.7061111111, NULL, 'Abu Tahun, K-', 281443.865527, 3454096.05515, '0', '01010000207C7F0000BBB54C768F2D1141BB270F07485A4A41');
INSERT INTO public.eessite VALUES (494, 'Natura, T', '0', NULL, NULL, '3km NE of Kafr Saqr', 'overbuilt', 670, 'A mound situated in cultivated land, covered by a modern cemetery, with a few houses at the east.', 'SCA Sharqiya register 13130055 (Naturah).', '30┬░48''56ÔÇ£', '31┬░38''36ÔÇ£', 30.8155555556, 31.6433333333, NULL, 'Natura, T', 370229.960222, 3409948.28461, '0', '01010000207C7F00009C6F44D7D7981641B9196E240E044A41');
INSERT INTO public.eessite VALUES (32, 'Abu Husa, T', '0', NULL, NULL, 'E of Simbellawein', '400 x 250┬á x 2m, 1984-5', 350, 'An oval mound with some modern buildings on the centre and west side, the edges cut by fields. Italian Survey 1987-8: Saite and Romano-Coptic sherds noted. SCA excavations from 2000 until 2007 found burials of Naqada IIIC and Dynasty I.', 'SCA Sharqiya register 13190060. SoE 1:25,000 series, 91/675; Chlodnicki and Fattovich in┬áCRIPEL14 (1992), 45-53. Brink,┬áMDAIK┬á43 (1986), 7-31, and on map in Brink,NDIT,┬á173; id. in Krzyzaniak,┬áStudies in African Archaeology┬á4 (1993), 288-9.', '30┬░55''56ÔÇ£', '31┬░43''27ÔÇ£', 30.9322222222, 31.7241666667, NULL, 'Abu Husa, T', 378110.370275, 3422788.14063, '0', '01010000207C7F00009E5E297BF9131741F1290012221D4A41');
