(2006)', 387, 'The mound has a village on the east end but some free land at the west, with a few modern graves on one edge. The location of this site on the SCA map is ascribed to a Kom Abu Atya, SCA┬á no. 100105.', 'SoE 1:100,000 (1916). SCA Beheira register no. 100101 is a site of this name at a different position, or just an erroneous transposition of numbers. Wilson, P.,┬áThe West Delta Regional Survey, Beheira and Kafr el-Sheikh Provinces, 156-7.', '31┬░0''55ÔÇ£', '30┬░18''50ÔÇ£', 31.0152777778, 30.3138888889, NULL, 'Abu Ismail, K', 243564.063631, 3434393.80579, '0', '01010000207C7F000040F8508260BB0D41712024E7CC334A41');
