INSERT INTO public.eessite VALUES (459, 'Menzala', '0', 'Panephysis', NULL, 'Menzala', 'under town', 483, 'Ancient Panephysis. In 1893, one mound still free from houses to E of city. Several metres long x 20m wide, 1-1.5m high. Sondage by Foucart produced no reported results. Large granite stones at elevated point in town.', 'Foucart, in┬áASAE┬á2 (1901), 65-66; Engelbach list.┬á', '31┬░9''0ÔÇ£', '31┬░56''0ÔÇ£', 31.15, 31.9333333333, NULL, 'Menzala', 398326.528134, 3446715.49422, '0', '01010000207C7F0000C828CF1CDA4F1841D99942BFDD4B4A41');
