INSERT INTO public.eessite VALUES (464, 'Minshat Abu Omar', '0', NULL, NULL, 'E of Tanis', '60 x 180 m 1966', 222, 'Earlier name Tell es-Sabaa Banat. Pre- and early dynastic cemeteries. Munich survey of 1966 and major excavations in 1970s - 80s. Much bibliography. Most of N. part levelled to fields by 2016; a small remnant has been test-pitted.┬áDetails', 'SCA Sharqiya register 13060017. M├╝ller, in┬áSBAW┬á8 (1966); Kroeper, K., ÔÇ£The Excavations of the Munich East-Delta Expedition in Minshat Abu Omar, in Brink,┬áArchaeology of the Nile Delta,┬á11-46; Kroeper,┬á in Spencer┬áAspects of Early Egypt, with re', '30┬░54''43ÔÇ£', '32┬░1''27ÔÇ£', 30.9119444444, 32.0241666667, NULL, 'Minshat Abu Omar', 406753.398236, 3420251.18493, '0', '01010000207C7F0000902DCB9785D3184147C9AB972D184A41');
