INSERT INTO public.eessite VALUES (466, 'Minshat Radwan', '0', NULL, NULL, '5.5km ESE of Kafr Saqr', 'overbuilt', 683, 'A large mound at the SW edge of the town, overbuilt by a modern cemetery. A patch of wasteland on the other side of the town suggests the┬átell┬áextended right across. The site rises to 5m. A dish and bowl of calcite and a pottery vessel, all Late Predyn', 'SCA Sharqiya register 13050087.', '30┬░46''55ÔÇ£', '31┬░41''15ÔÇ£', 30.7819444444, 31.6875, NULL, 'Minshat Radwan', 374411.317793, 3406172.55262, '0', '01010000207C7F000038876B452DDA16418E40BC46AEFC4941');
