INSERT INTO public.eessite VALUES (470, 'Mit Gharita', '0', NULL, NULL, '2.5km SW of Thmuis', 'destroyed ?', 526, 'Town of this name on 1:100,000 (1916) map, with a mound called Tell el-Humar situated 1.7km to the east. Finds: 3 fragments of grey granite naos with mythological scenes, Ptolemaic, in mosque. Objects in Cairo Museum from the site.', 'Kamal, in┬áASAE┬á5 (1904), 193-5;┬áPMIV:37; Engelbach list.', '30┬░55''50ÔÇ£', '31┬░28''20ÔÇ£', 30.9305555556, 31.4722222222, NULL, 'Mit Gharita', 354035.266964, 3422906.20536, '0', '01010000207C7F0000C5025F11CD9B15418A3C491A5D1D4A41');
