INSERT INTO public.eessite VALUES (320, 'Halyat, T. el-', '0', NULL, NULL, 'S. of Abu Shequq', 'part overbuilt', 735, 'Portions of this mound survive in the fields (2012): a western mound overbuilt by a cemetery and two grassy mounds up to 300m further east. Late Predynastic to OK pottery noted by Polish survey in 2011. Three low mounds separated by fields in 2012. West mound overbuilt by modern cemetery, others lie 300m to the east and are clear. Pottery from Naqada III to the 4th dynasty.', 'Jucha, M.A.. 2011,  ''Tell Abu el-Halyat. The new Naqada III - Old Kingdom (?) site in the northeastern Nile Delta'', Studies in Ancient Art and Civilization, 15, 65-75.', '30┬░48''56ÔÇ£', '31┬░35''48ÔÇ£', 30.815672419764894, 31.596567361313387, '31.596567361313387', 'Halyat, T. el-', 365756.3684104368, 3410016.4495611885, '0', '01010000207C7F0000E6954079F152164195388B3930044A41');
INSERT INTO public.eessite VALUES (700, 'Umm el Hagar, T', '0', NULL, NULL, 'N of Faqus', '100 x 100 x 1.8m', 191, 'Amsterdam University survey of 1984: The mound has been levelled except for small part, split by fields. Once extended to the west and covered 10 feddans. Saite, Ptolemaic and Roman sherds noted.', 'SoE 1:25,000 series, 90/690; Brink,MDAIK┬á43 (1986), 7ff., 21.', '30┬░49''8ÔÇ£', '31┬░50''43ÔÇ£', 30.8188888889, 31.8452777778, NULL, 'Umm el Hagar, T', 389551.848222, 3410100.80685, '0', '01010000207C7F0000D74E9464BFC617415DDC46675A044A41');
INSERT INTO public.eessite VALUES (701, 'Umm el Hagar, T', '0', NULL, NULL, 'E of Husseiniya', 'part levelled', 202, 'This site includes the edge of a village on a mound and some of the adjacent cultivated land. Now known only as Farm no. 3 Bahr el-Baqar. Perhaps the same as T. Qarqada (no. 201).', 'SCA Sharqiya register 13060011, under the name ''Zaraah 3 Bahr el-Baqar''.', '30┬░53''36ÔÇ£', '32┬░5''49ÔÇ£', 30.8933333333, 32.0969444444, NULL, 'Umm el Hagar, T', 413691.328962, 3418129.93023, '0', '01010000207C7F00001F6ADB50ED3F1941D2C611F708144A41');
