INSERT INTO public.eessite VALUES (703, 'Umm el Lahm (ii), T', '0', NULL, NULL, '3km W of San el Hagar', 'cultivated', 488, 'An extensive area of cultivated land owned by the SCA, adjacent to the sites of T. el-Tahun and T. ed-Deir el-Hamra (the combined area being one large site).', 'SCA Sharqiya register 13090108. The sites of this name from older maps, Umm el-Lahm (N) and (S), are EES nos. 162 and 165. These still have visible mounds.', '30┬░59''17ÔÇ£', '31┬░51''15ÔÇ£', 30.9880555556, 31.8541666667, NULL, 'Umm el Lahm (ii), T', 390594.720569, 3428841.4803, '0', '01010000207C7F000006D7DCE10AD717416C787ABDF4284A41');
INSERT INTO public.eessite VALUES (704, 'Umm el Lahm (N), T', '0', NULL, NULL, '2km WNW of San el Hagar', '26550 sq. m. 1987', 162, 'Italian survey 1987-8: well-preserved Ptolemaic - Roman site. No mention of pottery in id.,┬áBull. GIECE┬á13, 22-6. Satellite imagery (2004) shows the mound cut to a rectangular shape by advance of the fields. A part at the NW being levelled in 2016', 'SCA Sharqiya register 13060029. SoE 1:25,000 series, 91/690; ESA 1:50,000 map (1996), sheet NH36-J4d. Chlodnicki and Fattovich in┬áCRIPEL┬á14 (1992), 45-53. Id., map in Brink,┬áNDIT, 173.', '30┬░58''9ÔÇ£', '31┬░50''9ÔÇ£', 30.9691666667, 31.8358333333, NULL, 'Umm el Lahm (N), T', 388822.224772, 3426766.09084, '0', '01010000207C7F000094A12AE658BB174127A5A00BE7244A41');
