INSERT INTO public.eessite VALUES (742, 'Hashem, K', NULL, NULL, NULL, 'E of Abu Hummus', NULL, 642, 'Small tell here on satellite imagery, clear until winter of 2015, then a structure was built on it. The site consists of a sandy area, with a few pottery sherds lying on the surface.', 'SCA Beheira register no. 100189. Wilson, P., The West Delta Regional Survey, Beheira and Kafr el-Sheikh Provinces, 119-20, 349-50.', '31°12''05"N', ' 30°19''46"E', 31.20166667, 30.32944444, NULL, 'Hashem, K', 245547.65, 3455025.49, '0', '01010000207C7F0000333333335DF90D41EC51B8BE185C4A41');
