INSERT INTO public.eessite VALUES (744, 'Abu Mandour', NULL, NULL, NULL, NULL, '720 x 250m', 0, 'The site is a large, sand-covered rock outcrop beside the Rosetta branch of the Nile, reaching a height of 15-18 metres and running lengthways along the river. It does not have a SCA number, perhaps because it is considered historical.', 'Ibn Duqmaq (d. 1406) mentioned Kom al Afra as a hill for holy people and that it was a blessed place. SCA excavations have uncovered pharaonic pottery sherds.', '31°23.127', '30°25.259', 31.385022, 30.42076, NULL, NULL, 254726.82, 3475149.55, NULL, '01010000207C7F0000F6285C8F36180F41666666C666834A41');
